import storage from "../utils/storage";

const getDaysExercise = exercise => new Promise(resolve => {
    storage.getAll().then(data => {
        resolve(Object.entries(data).reduce((acc, [key, value]) => {
            if(!key.includes("/")) return acc;
            const exerciseInDay = value.find(e => e.name === exercise);
            console.log(exerciseInDay);
            if(!exerciseInDay) return acc;
            return [...acc, {date: key, series: exerciseInDay.series}];
        }, []));
    });
});

export {
    getDaysExercise
}
